import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import Login from "./pages/Login";
import Register from "./pages/Register";
import Loggedin from "./pages/Loggedin";
import Dashboard from "./pages/Dashboard";
import Invest from "./pages/Invest";
import Portfolios from "./pages/Portfolios";
import Profile from "./pages/Profile";
import Watchlist from "./pages/Watchlist";
import NoPage from "./pages/NoPage";
import PrivateRoute from "./components/PrivateRoute";

export default function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/home" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/loggedin" element={<Loggedin />} />
          <PrivateRoute path="/dashboard" element={<Dashboard />} />
          <PrivateRoute path="/dashboard/invest" element={<Invest />} />
          <PrivateRoute path="/dashboard/portfolios" element={<Portfolios />} />
          <PrivateRoute path="/dashboard/profile" element={<Profile />} />
          <PrivateRoute path="/dashboard/watchlist" element={<Watchlist />} />
          <Route path="*" element={<NoPage />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}
